void mainImage( out vec4 fragColour, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = (fragCoord * 2.0 - iResolution.xy) / iResolution.y;
    vec3 col = vec3(1.0);


    for (float i = 0.00; i < 1.0; i++) {
        uv = fract(uv * 5.0);

        float xdist = distance(0.0, uv.x);
        float ydist = distance(0.0, uv.y);

        if (xdist < 0.95 && ydist < 0.95) {
            col = vec3(uv.y + sin(iTime)) * (vec3(0.882,0.667,0.200) + vec3(0.3 * cos(iTime) - 0.8)) * 1.5;
        }
    }

    // Output to screen
    fragColour = vec4(col,1.0);
}
